import React from "react";
import Header from "./Header";


function Three_Product(){
    return(
        <>
        <div className="catalaug">
           <div className="upper_part">
               <div className="catalaug_name"> Vegetables</div>
               <button className="view_all">View All <b><span  className="iconify" data-icon="mdi:chevron-right" data-inline="false" id="arrow"></span></b> </button>
           </div>
           <div className="lower_part"></div>

        </div>
        
         </>
    );

}

export default Three_Product;
